INSERT [dbo].[Artistas] ([ID], [varbImagen], [nvarchImageMimeType], [nvarchNombre], [nvarchPais], [intAño], [IDGenero], [nvarchBiografia]) VALUES (3, , N'image/jpeg', N'Ramones', N'Estados Unidos', 1974, 7, N'Grupo estadounidense de punk-rock formado por el cantante Joey Ramone (Jeffrey Hyman, 1952 - 2001), el bajista Dee Dee Ramone (Douglas Colvin, 1952 - 2002), el guitarrista Johnny Ramone (John Cummings, 1948 - 2004) y el batería húngaro Tommy Ramone (Tom Erdelyi, 1952), que sería substituido en 1978 por el percusionista Marky Ramone (Marc Bell, 1956). Creada en 1974 en el distrito neoyorquino de Queens, The Ramones fue, junto a The Sex Pistols y The Clash, una de las bandas centrales del movimiento punk.')
GO
INSERT [dbo].[Artistas] ([ID], [varbImagen], [nvarchImageMimeType], [nvarchNombre], [nvarchPais], [intAño], [IDGenero], [nvarchBiografia]) VALUES (6, , N'image/jpeg', N'Deep Purple', N'Inglaterra', 1968, 6, N'Deep Purple fue una banda creada en Gran Bretaña a finales de la década de los 60.
Evolucionaron desde el rock psicodélico y progresivo hacia el hard rock, siendo base del heavy metal surgido en los años 70.')
GO
INSERT [dbo].[Artistas] ([ID], [varbImagen], [nvarchImageMimeType], [nvarchNombre], [nvarchPais], [intAño], [IDGenero], [nvarchBiografia]) VALUES (7, , N'image/jpeg', N'Jimi Hendrix', N'Estados Unidos', 1966, 5, N'(James Marshall Hendrix; Seattle, Estados Unidos, 1942 - Londres, 1970) Guitarrista estadounidense de rock. Según la discografía oficial, tiene unos veinte discos editados, si bien tan sólo publicó tres en vida: Are you Experienced? (1967), Bold as Love (1967) y Electric Ladyland (1968). Sin embargo, su genio y originalidad han perdurado de tal modo que medio siglo después de su fallecimiento sigue siendo el referente principal de los grandes guitarristas. Desarrolló la técnica y los efectos de la guitarra eléctrica hasta dotarla de una entidad propia, mediante la saturación de sonido en los amplificadores y el uso del pedal wah-wah para generar efectos sonoros.')
GO
INSERT [dbo].[Artistas] ([ID], [varbImagen], [nvarchImageMimeType], [nvarchNombre], [nvarchPais], [intAño], [IDGenero], [nvarchBiografia]) VALUES (8, , N'image/jpeg', N'Judas Priest', N'Inglaterra', 1969, 8, N'parecidos en 1967, aunque la formación inicial nada tiene que ver con los miembros claves del grupo, Judas Priest, nombre derivado de un tema de Bob Dylan (“The Ballad of Frankie Lee and Judas Priest”), es una de las bandas más significativas del metal de finales de los 70 y comienzos de los 80, época dorada para las bandas heavy.')
